import React from 'react';
import './Sidebar.css';

const sideDrawer = props => (
    <nav className = "side-drawer">
        <ul>
            <li><a href="/">HOME</a></li>
            <li><a href="/">OUR TEAM</a></li>
            <li><a href="/">JOIN US!</a></li>
            <li><a href="/">CONTACT</a></li>
        </ul> 
    </nav>
);

export default sideDrawer;
